medium: { material: GaAs, eps: adachi_T, df: 0.0 },
exciton: { w0: 1.7, G0: 0.0005, G: 0.01 },
d: 10;

material: AlGaAs, eps: adachi_simple, d: 100, df: 0.0, cAl: 0.35;
material: custom, d: 0, eps: {
  fun f(x) = sin(x * 0.1) * 0.5
  fun g(x) = cos(x * 0.1) * 0.5
  return (f(x), g(x))
};

